import React, { Fragment } from "react";
import Button from "../UI/Button";

const MealsData = [
  {
    id: "m1",
    name: "sushi",
    price: "12.99",
  },
  {
    id: "m2",
    name: "miso soup",
    price: "2.99",
  },
  {
    id: "m3",
    name: "bao bao",
    price: "8.99",
  },
];

const AvailableMeals = () => {
  const meals = MealsData.map((meal) => (
    <li>
      {meal.name}
      {meal.price}
      <Button />
    </li>
  ));
  return (
    <Fragment>
      <ul>{meals}</ul>
    </Fragment>
  );
};
export default AvailableMeals;
